gYi(){return"**Disclaimer per il Non Utilizzo dei Dati Personali**\n\nLa nostra piattaforma raccoglie alcune informazioni personali al fine di condurre analisi statistiche. Riteniamo fondamentale informarvi che i dati forniti, tra cui email, sesso biologico, et\xe0, titolo di studio, sensibilit\xe0 al rumore, uso di protesi uditive e difficolt\xe0 uditive, saranno utilizzati esclusivamente per scopi statistici e di ricerca interna. Ecco come gestiamo questi dati:\n- Email: La vostra email sar\xe0 utilizzata solo per scopi di contatto diretto legati alla ricerca e non sar\xe0 condivisa con terze parti n\xe9 utilizzata per scopi di marketing.\n- Sesso Biologico: Questa informazione \xe8 raccolta esclusivamente per analisi statistiche e non sar\xe0 utilizzata per scopi di profilazione o discriminazione.\n- Et\xe0: La vostra et\xe0 \xe8 richiesta unicamente per analisi demografiche nell'ambito della ricerca statistica. Non sar\xe0 utilizzata per scopi commerciali o pubblicitari.\n- Titolo di Studio: Il titolo di studio \xe8 raccolto per comprendere meglio il background degli utenti a fini statistici. Non sar\xe0 condiviso con terze parti n\xe9 utilizzato per altri scopi.\n- Sensibilit\xe0 al Rumore: Questa informazione \xe8 raccolta esclusivamente per fini di ricerca statistica. Non sar\xe0 utilizzata in altro modo.\n- Protesi Uditiva: Le informazioni sull'uso di protesi uditive sono raccolte per fini statistici. Non saranno condivise o utilizzate per altri scopi.\n- Difficolt\xe0 Uditiva: Questi dati sono raccolti per fini statistici. Non saranno utilizzati per scopi diversi da quelli dichiarati.\n\n**Protezione dei Dati**\n\nCi impegniamo a proteggere la vostra privacy e a garantire che tutte le informazioni personali siano trattate in conformit\xe0 con le normative vigenti sulla protezione dei dati. I vostri dati saranno conservati in modo sicuro e accessibili solo al personale autorizzato.\n\n**Uso Limitato dei Dati**\n\nVi assicuriamo che i dati forniti non saranno utilizzati per:\n- Scopi pubblicitari o di marketing non richiesti\n- Vendita o condivisione con terze parti non autorizzate\n- Attivit\xe0 di profilazione o discriminazione\n\n**Diritti degli Utenti**\n\nAvete il diritto di accedere, correggere o cancellare i vostri dati personali in qualsiasi momento. Per esercitare questi diritti o per qualsiasi domanda riguardante la nostra politica sulla privacy, vi preghiamo di contattarci all'indirizzo email ipcfpisa2024@outlook.it.\n\n**Accettazione della Privacy Policy**\n\nUtilizzando il nostro sito e fornendo i vostri dati, accettate i termini di questa Privacy Policy."},
gX5(){return'**Inserimento email**\n\nInserimento email nella pagina principale e accesso al pannello per l\'etichettatura tramite il bottone "Inizia l\'etichettatura".\n\n**Pannello etichettatura generale**\n\nNel bottone "Informazioni utente" \xe8 possibile accedere alla form per aggiungere le informazioni personali utilizzate per scopi di statistica. Tramite i bottoni "Traccia 1", ..., "Traccia n" \xe8 possibile accedere alla schermata per l\'etichettatura della traccia i-esima. In alto a destra sono presenti i bottoni per accedere a "Istruzioni" e "Privacy Policy" oltre al bottone per "Invio delle etichette".\n\n**Informazioni utente**\n\nSchermata che permette l\'aggiunta dei dati personali. Bisogna completare tutti i campi per inviare il sondaggio. Sul bottone relativo a questa schermata comparir\xe0 un contrassegno verde per stabilire che i dati inseriti sono conformi all\'invio.\n\n**Traccia i**\n\nSchermata per l\'etichettatura dell\'i-esima traccia sonora. Dopo il caricamento nella schermata saranno presenti: \n- *spettro* relativo all\'istante della traccia che si sta ascoltando. Inizialmente esso viene rappresentato rispetto al primo istante della traccia audio\n- *spl*: sound level pressure della traccia audio. All\'interno del riquadro dove viene mostrato l\'spl \xe8 possibile muovere il cursore per selezionare l\'istante temporale della traccia audio cos\xec da vedere lo spettro ad un certo istante temporale (il cursore \xe8 una linea verticale rossa). Inoltre in questo riquadro viene mostrata una selezione in rosso chiaro (piccolo riquadro che evidenzia una porzione del spl). Questo elemento pu\xf2 essere adattato a sinistra o a destra (premendo vicino al lato sinitro o destro e scorrendo tenendo premuto) cos\xec da poter evidenziare in maniera visuale l\'evento sonoro interno alla traccia audio rappresentata graficamente dal spl. Per assegnare alla selezione il tipo dell\'evento sonoro basta pigiare il bottone relativo alla sua classe (esempio: "macchina") nella lista "Classi da selezionare". Appena questo viene fatto l\'etichetta viene aggiunta nel riquadro al di sotto del spl chiamato "Riquadro delle etichette"\n- Riquadro delle etichette: riquadro dove vengono riportate le etichettaure mostrando il loro tipo e la loro posizione. Queste etichette possono essere modificate in termini di posizione temporale muovendo i loro lati sinistro o destro muovendoli con il cursore.\n- Classi da selezionare: lista delle classi che possono essere assegnate ad un etichetta\n- Bottone play/pausa: bottone utile a riprodurre la traccia audio o metterla in pausa\n- Etichette assegnate: Vista complementare al "Riquadro delle etichette" che permette di visualizare le etichette assegnate riportando il tipo (o classe), la percentuale di inizio e la percentuale di fine (percentuale all\'interno della traccia audio). In tale vista \xe8 possibile anche rimuovere l\'etichetta in caso di errore.\nIn questa schermata \xe8 possibile selezionare pi\xf9 di una etichetta anche dello stesso tipo (o classe). Per ogni traccia deve essere selezionata almeno un etichetta. Sul bottone relativo a questa schermata comparir\xe0 un contrassegno verde per stabilire che i dati inseriti sono conformi all\'invio.\n\n**Invio delle etichette**\n\nBottone per l\'invio delle etichette. Se questo viene premuto appare una schermata che chiede di inserire la condizione dell\'ambiente circostante che pu\xf2 essere "Silenzioso" o "Rumoroso". Appena uno tra questi due bottoni viene premuto i dati relativi alle informazioni utente ed alle etichette assegnate a tutte le tracce vengono inviate. Questo bottone \xe8 disattivato fino al momento in cui tutti i dati necessari vengono completati (ovvero quando tutti i bottoni con un icona presentano un contrassegno verde).'},
